LL calc(LL n) {
	LL ans = 0;
	while (n) {
		ans += (n >> 1);
		n >>= 1;
	}
	return ans;
}

LL f(LL x) {
	if (x <= 1) return 1;
	if (x < MO) {
		if (x < step && vis[x]) return g[x];
		int k = x / step;
		LL ans = mp[k];
		for (LL i = k * step + 1; i <= x; i += 2) {
			ans = ans * i;
		}
		ans *= f(x >> 1);
		if (x < step) vis[x] = 1, g[x] = ans;
		return ans;
	}
	if (x & 1) {
		return f(x & (step - 1)) * f(x >> 1);
	}
	else {
		return f(x - 1) * f(x >> 1);
	}
}

LL pow_mod(LL a, LL b = (1LL << 31) - 1) {
	LL ans = 1;
	while (b) {
		if (b & 1) ans = ans * a;
		b >>= 1;
		a = a * a;
	}
	return ans;
}

int main() {
	ios :: sync_with_stdio(0);
	LL n, k;
	cin >> n >> k;
	int cnt = calc(n) - calc(k) - calc(n - k);
	if (cnt >= 32) {
		cout << 0 << endl;
		return 0;
	}
	LL a = f(n), b = f(n - k), c = f(k);
	LL ans = a * pow_mod(b) * pow_mod(c);
	ans &= (1LL << (32 - cnt)) - 1;
	ans *= 1LL << cnt;
	ans &= (MO - 1);
	cout << ans << endl;

	return 0;
}

